import Vue from 'vue'
import Router from 'vue-router'

import HomeIndex from '@/views/home'

Vue.use(Router)

export const routerMap = [
    {
        path: '/',
        component: HomeIndex,
        children: [
            { path: '/', component: () => import('@/views/home') },
        ]
    }
]

const router = new Router({
        routes: routerMap
    }
)

export default router
